import { useEffect, useState } from "react";
import { getProducts } from "../server";
import Layout from "../components/layout/layout";
import Card from "../components/card";

function CollectionX(props) {
  const [products, setProducts] = useState([]);
  const position = {
    wrapper: "*:inline-block *:w-1/3",
  };

  useEffect(() => {
    getProducts({ category: props.category }, setProducts);
  }, [props.category]);

  return (
    <Layout>
      <div className={position.wrapper}>
        {products && products.map((product) => <Card product={product} />)}
      </div>
    </Layout>
  );
}

export default CollectionX;
